function _task {
    if [[ $TASK != "" ]]; then
        printf "${OVERWRITE}${LGREEN} [✓]  ${LGREEN}${TASK}\n"
    fi
    TASK=$1
    printf "${LBLACK} [ ]  ${TASK} \n${LRED}"
}

# _cmd performs commands with error checking
function _cmd {
    > debug.log
    if eval "$1" 1> /dev/null 2> debug.log; then
        return 0 # success
    fi
    printf "${OVERWRITE}${LRED} [X]  ${TASK}${LRED}\n"
    while read line; do 
        printf "      ${line}\n"
    done < debug.log
    printf "\n"
    rm debug.log
    set -o history
    exit 1
} 

name="fluxcore-linux-amd64"

clear_screen() {
  clear
}

check_command() {
  local command=$1
  local package=$2
  if ! command -v $command >/dev/null 2>&1; then
    echo "$command is not installed. Installing $package..."
    sudo apt-get -qq update
    sudo apt-get install -y $package
    echo "$package has been installed."
  else
    echo "$command is already installed."
  fi
}

service_exists() {
  service_name=$1
  if systemctl list-units --full -all | grep -Fq "$service_name.service"; then
    return 0
  else
    return 1
  fi
}

get_local_ip() {
# Retrieve the list of IP addresses
ip_list=($(ip addr show | grep 'inet ' | awk '{print $2}' | cut -d'/' -f1 | uniq))
elements=${#ip_list[@]}
# Prepare the choices array for whiptail
choices=()
for (( i=0; i<$elements; i++ )); do
  if [[ "$i" == "0" ]]; then
    choices+=("${ip_list[i]}" "" "ON")
  else
    choices+=("${ip_list[i]}" "" "OFF")
  fi
done
# Display the whiptail dialog
IP=$(whiptail --title "Which IP to bind for pouwfrontend web server?" \
           --radiolist " \nUse the UP/DOWN arrows to highlight the IP you want. Press Spacebar on the IP you want to select, THEN press ENTER." 25 55 15 \
           "${choices[@]}" 3>&2 2>&1 1>&3)
# Display the selected IP address (for debugging purposes)
echo "Selected IP: $IP"
}

daemon_setup() {
  clear_screen
  echo "Fluxcore for Linux AMD64 [PRODUCTION]"
  echo "Please allow privileges to access hardware info to the program."
  sudo -nv 2>/dev/null
  sudo_status=$?
  if [ $sudo_status -eq 1 ]; then
    echo "Sudo requires a password. Please enter your password."
    if ! sudo -v; then
      echo "Incorrect sudo password. Exiting script."
      exit 1
    fi
  elif [ $sudo_status -ne 0 ]; then
    echo "You do not have sudo privileges. Exiting script."
    exit 1
  fi
  if ! id "fluxuser" &>/dev/null; then
    _task "Create user fluxuser"
    _cmd "sudo useradd -p '' -r -s /bin/bash -m fluxuser"
    echo "fluxuser ALL=(ALL:ALL) NOPASSWD: ALL" | sudo tee "/etc/sudoers.d/dont-prompt-fluxuser-for-sudo-password"
  fi
  echo -e "=============================================================================================================="
  _task "Download the Fluxcore executable"
  if service_exists "fluxcore"; then
    _cmd "sudo systemctl stop fluxcore.service"
    _cmd "sudo systemctl disable fluxcore.service"
  fi
  _cmd "sudo curl -o /home/fluxuser/$name https://download.fluxcore.ai/$name"
  _task "Set permissions for Fluxcore executable"
  _cmd "sudo chown fluxuser:fluxuser /home/fluxuser/$name && sudo chmod +x /home/fluxuser/$name"
  _cmd "sudo setcap 'CAP_DAC_READ_SEARCH+eip cap_net_bind_service=+ep' /home/fluxuser/$name"
  _cmd "sudo chmod u+s,+x /home/fluxuser/$name"
  _task "Configure and start Fluxcore service"
  get_local_ip
  IP=${IP:-127.0.0.1}
  _cmd "sudo curl -o /lib/systemd/system/fluxcore.service https://download.fluxcore.ai/fluxcore.service"
  _cmd "sudo sed -i "s/127.0.0.1/$IP/g" /lib/systemd/system/fluxcore.service"
  _cmd "sudo systemctl daemon-reload"
  _cmd "sudo systemctl enable fluxcore.service"
  _cmd "sudo systemctl start fluxcore.service"
  printf "${OVERWRITE}${LGREEN} [✓]  ${LGREEN}${TASK}\n ${RESTORE}"
  echo -e ""
  systemctl status --no-pager fluxcore.service
  echo
  echo -e "${PIN} ${CYAN}You can access it here:  ${SEA}http://$IP:18180${NC}"
  echo -e "${PIN} ${CYAN}Be aware to sign in, third parties like Github, Google, etc. require you to have a domain name.${NC}"
  echo -e "${PIN} ${CYAN}You can add the IP of your remote to the host file under the name 'machine1.remote.fluxcore', 'machine2.remote.fluxcore', ... ${NC}"
  echo
}


uninstall() {
 clear_screen
 UBUNTU_VERSION=$(lsb_release -rs)
 echo "Detected Ubuntu version: $UBUNTU_VERSION"
 echo "Please allow privileges to remove program"
 sudo -nv 2>/dev/null
 sudo_status=$?
 if [ $sudo_status -eq 1 ]; then
   echo "Sudo requires a password. Please enter your password."
   if ! sudo -v; then
     echo "Incorrect sudo password. Exiting script."
     exit 1
   fi
 elif [ $sudo_status -ne 0 ]; then
   echo "You do not have sudo privileges. Exiting script."
   exit 1
 fi
 if service_exists "fluxcore"; then
  _task "Removing fluxcore service" 
  _cmd "sudo systemctl stop fluxcore.service"
  _cmd "sudo systemctl disable fluxcore.service"
  _cmd "sudo rm /lib/systemd/system/fluxcore.service"
 fi

 if [[ -f  /home/fluxuser/$name ]]; then
  _task "Removing fluxcore binary" 
  _cmd "sudo rm /home/fluxuser/$name"
 fi
 _task "Reloading systemctl daemon" 
 _cmd "sudo systemctl daemon-reload"
 if [[ -d  /home/fluxuser ]]; then
   _task "Removing user fluxuser" 
   _cmd "sudo deluser --remove-home fluxuser"
 fi

  _task "Removing Kubernetes and related files..." 
 if [[ -f /usr/local/bin/rke2-uninstall.sh ]]; then
   sudo /usr/local/bin/rke2-uninstall.sh
 fi
 sudo rm -rf /etc/ceph \
 /etc/cni \
 /etc/kubernetes \
 /etc/rancher \
 /opt/cni \
 /opt/rke \
 /run/secret/kubernetes.io \
 /run/calico \
 /run/flannel \
 /var/lib/calico \
 /var/lib/etcd \
 /var/lib/cni \
 /var/lib/kubelet \
 /var/lib/rancher \
 /var/log/containers \
 /var/log/kube-audit \
 /var/log/pods \
 /var/run/calico >/dev/null 2>&1
 printf "${OVERWRITE}${LGREEN} [✓]  ${LGREEN}${TASK}\n ${RESTORE}"
 echo "Uninstallation of FlucCore complete."
}

fix_frankenstein() {
  curl -o fix-frankenstein.sh https://pouwdev.runonflux.io/update/fix-frankenstein.sh
  bash fix-frankenstein.sh
}

check_command "lsb_release" "lsb-release"
check_command "wg-quick" "wireguard wireguard-tools udhcpc"

if ! command -v whiptail &> /dev/null; then
  sudo apt-get update -y 
  sudo apt-get install -y whiptail
fi

UBUNTU_VERSION=$(lsb_release -rs)
echo "Detected Ubuntu version: $UBUNTU_VERSION"
clear_screen

echo -e "$Banner"
echo -e "=================================================================================================================[PRODUCTION]"
echo -e "1) Install FluxCore"
echo -e "2) Uninstall FluxCore"
echo -e "3) Fix Frankenstein Script"
echo -e "============================================================================================================================="
read -rp "Pick an option and hit ENTER: "
case "$REPLY" in
 1)  
 		clear
		sleep 1
		daemon_setup

 ;;
 2) 
		clear
		sleep 1
		uninstall
 ;;
 3)     
		clear
		sleep 1
		fix_frankenstein
 ;;
 esac
 set -o history
